// Overall page styling
* {
  box-sizing: border-box;
  -webkit-tap-highlight-color: transparent;
  cursor: default;
  // cursor: none;
  // user-select: none;
  // -webkit-user-drag: none;
}

.icon-link {
  // width: 0.5px;
  size: 1em;
  // padding: 1em;
  padding-bottom: 2em;
}

.logo-social {
  width: 1.6em;
}

//body styling
body {
  overflow: hidden;
  background: #fff;
  color: white; // font color
  height: 100vh;
  margin: 0;
  font-family: "Poppins";
  font-size: 1.5rem;
}

a {
  text-decoration: none;
  color: black;

  :visited {
    text-decoration: none;
  }
}

//social media icon container
.container {
  margin-top: 5em;
  padding-right: 15%;
  display: block;
  float: right;
}

//naviagation bar styling
.cta {
  text-decoration: none;
  color: aliceblue;
  font-size: 1.2rem;
  // cursor: pointer;
}


@media only screen and (min-width: 600px) {
  header {
    width: 100%;
    display: inline-flex;
    justify-content: space-between;
    align-items: center;
    padding: 25px 15%;
  }


}





.hamburger-container {
  display: table-cell;
  padding-right: 20px;


}


.logo {
  // width: 5%;
  width: 2em;
}

.app_icon {
  // size: 5em;
  width: 1%;
}



// navigation bar text
.header-text {
  --text: rgb(255, 255, 255);
  --font-size: 16px;
  font-weight: 300;
  line-height: 1;
  border-radius: 24px;
  display: table-cell;
  padding: 1em;
  // padding-right: 2.3em;
  outline: none;
  text-decoration: none;
  font-size: var(--font-size);
  letter-spacing: .5px;
  background: var(--background);
  // color: var(--text);
  color: #000;
  box-shadow: var(--shadow);

  div {
    display: flex;

    span {
      display: block;
      backface-visibility: hidden;
      font-style: normal;
    }
  }


}



.bodysection {
  // color: rgb(255, 255, 255);
  position: relative;
  // padding: 0em 0em 2em 2em;
  padding: 25px 15%;
  height: 100vh;
}

//cursor styling
.cursor {
  width: var(--size);
  height: var(--size);
  border-radius: 50%;
  background: #F2DD8C;
  position: absolute;
  z-index: 999;
  pointer-events: none;
  box-shadow: 0px 0px 15px -5px white;
  mix-blend-mode: difference;

  &-f {
    width: var(--size);
    height: var(--size);
    position: absolute;
    top: 0;
    left: 0;
    background-image: url("data:image/svg+xml,%3Csvg width='47' height='47' viewBox='0 0 47 47' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath d='M42.4202 42.4202C38.8403 46 33.3594 46 23.5 46C13.6406 46 8.15966 46 4.57983 42.4202C1 38.8403 1 33.3594 1 23.5C1 13.6406 1 8.15966 4.57983 4.57983C8.15966 1 13.6406 1 23.5 1C33.3594 1 38.8403 1 42.4202 4.57983C46 8.15966 46 13.6406 46 23.5C46 33.3594 46 38.8403 42.4202 42.4202Z' stroke='white'/%3E%3C/svg%3E%0A");
    background-size: cover;
    mix-blend-mode: difference;
    pointer-events: none;
    opacity: 0;
  }
}


.loader_container {
  min-height: 100vh;
  background: #1a1a1a;
  display: flex;
  justify-content: center;
  align-items: center;
}

.loader {
  --path: #fff;
  --dot: #F2DD8C;
  --duration: 3s;
  width: 44px;
  height: 44px;
  position: relative;

  &:before {
    content: '';
    width: 6px;
    height: 6px;
    border-radius: 50%;
    position: absolute;
    display: block;
    background: var(--dot);
    top: 37px;
    left: 19px;
    transform: translate(-18px, -18px);
    animation: dotRect var(--duration) cubic-bezier(0.785, 0.135, 0.15, 0.86) infinite;
  }

  svg {
    display: block;
    width: 100%;
    height: 100%;

    circle {
      fill: none;
      stroke: var(--path);
      stroke-width: 10px;
      stroke-linejoin: round;
      stroke-linecap: round;
    }

    circle {
      stroke-dasharray: (200 / 4 * 3) (200 / 4) (200 / 4 * 3) (200 / 4);
      stroke-dashoffset: 75;
      animation: pathCircle var(--duration) cubic-bezier(0.785, 0.135, 0.15, 0.86) infinite;
    }
  }

}

.text1 {
  font-weight: 500;
  font-size: 50px;

  color: #000000;



  &span {
    font-weight: 500;
    color: #000;
    // font-size: 20%;
  }

  padding-bottom: 0.7%;
}

